ఈ భాష పత్రికబెంగాలీ లో ప్రచురించబడుతుంది దీని ప్రధాన కార్యాలయం కోల్‌కతా లో ఉంది.ఈ పత్రికను ABP గ్రూప్ కంపెనీ ప్రచురిస్తుంది.ఇది భారతదేశం లోని పత్రిక సీజర్ బాగ్చీ ,ఈ పత్రిక సంపాదకుడు.ఈ పత్రిక మాజీ సంపాదకులు అశోక్ కుమార్ సర్కార్ నిరేంద్రనాథ్ చక్రవర్తి దేబాసిష్ బంద్యోపాధ్యాయ పౌలమి సేన్‌గుప్తా. ఈ పత్రికా స్థాపించిన సంవత్సరం 1975.1975-03-01 00:00:00 తేదీన ఈ పత్రిక మొదటి సంచిక విడుదలైంది. విటి వర్గాలు ఏంటంటే,పిల్లల పత్రిక.దినికి 60000సర్క్యులేషన్ ఉంది.ఈ పత్రిక యొక్క ఫ్రీక్వెన్సీ పక్షం. ==మూలాలు==
