==దేశ్ మ్యాగజైన్==
ఇది ఒక బెంగాలీ భాష పత్రిక.ఏబీపీ గ్రూప్దీన్ని ప్రచురించినవారు. కోల్‌కతా లో దీని ప్రధాన కార్యాలయం ఉంది.ఈ పత్రికను ABP గ్రూప్ కంపెనీ ప్రచురిస్తుంది.ఇది భారతదేశం లోని పత్రిక సాగర్‌మోయ్ ఘోష్ ,ఈ పత్రిక సంపాదకుడు. ఈ పత్రికా స్థాపించిన సంవత్సరం 1933.ఈ పత్రిక మొదటి సంచిక 1933 తేదీన విడుదలైంది. విటి వర్గాలు ఏంటంటే,ప్రస్తుత, చారిత్రక మరియు సాంస్కృతిక ఆసక్తి.ఇది 59000 సర్క్యులేషన్ కలిగి ఉంది.ఈ పత్రిక యొక్క ఫ్రీక్వెన్సీ రెండు రాత్రికి. ==మూలాలు==
