ఈ భాష పత్రికహిందీ, బంగ్లా, గుజరాతీ, కన్నడ, మలయాళం, మరాఠీ, తమిళం, తెలుగు లో ప్రచురించబడుతుంది న్యూఢిల్లీ లో దీని ప్రధాన కార్యాలయం ఉంది.ఈ పత్రికను ఢిల్లీ ప్రెస్ కంపెనీ ప్రచురిస్తుంది.ఇది భారతదేశం లోని పత్రిక ఆశిష్ శ్రీవాస్తవ ,ఈ పత్రిక సంపాదకుడు.ఈ పత్రిక మాజీ సంపాదకులు ఆశిష్ శ్రీవాస్తవ. 1979 సంవత్సరంలో ఈ పత్రిక స్థాపించబడింది.ఈ పత్రిక మొదటి సంచిక 1979 తేదీన విడుదలైంది. విటి వర్గాలు ఏంటంటే,మహిళా పత్రికలు.దినికి 33,33,651సర్క్యులేషన్ ఉంది.ఈ యొక్క పత్రిక ఫ్రీక్వెన్సీ ,వారం వారం. ==మూలాలు==
