ఇది ఒక ఆంగ్ల భాష పత్రిక.అశోక్ హాట్‌చంద్ అద్వానీదీన్ని ప్రచురించినవారు. ముంబై లో దీని ప్రధాన కార్యాలయం ఉంది.ఈ పత్రికను ప్రచురిసితున్న కంపెనీ,బిజినెస్ ఇండియా పబ్లికేషన్స్ లిమిటెడ్.ఇది భారతదేశం లోని పత్రిక
ఈ పత్రికా స్థాపించిన సంవత్సరం 1978.1978-02-01 00:00:00 తేదీన ఈ పత్రిక మొదటి సంచిక విడుదలైంది. విటి వర్గాలు ఏంటంటే,వ్యాపార వార్తలు.ఈ యొక్క పత్రిక ISSN సంఖ్య ,0254-5268.ఈ యొక్క పత్రిక ఫ్రీక్వెన్సీ ,పక్షం రోజులు. ==మూలాలు==
