ఈ భాష పత్రికఆంగ్ల లో ప్రచురించబడుతుంది నోయిడా, ఉత్తరప్రదేశ్ లో దీని ప్రధాన కార్యాలయం ఉంది.ఈ పత్రికను ప్రచురిసితున్న కంపెనీ,లివింగ్ మీడియాఇది భారతదేశం లోని పత్రిక ఈ పత్రిక సంపాదకుడు ప్రోసెన్‌జిత్ దత్తా.సంజోయ్ నారాయణ్ ,వీళ్ళు ఈ పత్రిక మాజీ సంపాదకులు ఈ పత్రికా స్థాపించిన సంవత్సరం 1992.ఈ పత్రిక మొదటి సంచిక ఫిబ్రవరి, 1978 తేదీన విడుదలైంది. విటి వర్గాలు ఏంటంటే,వ్యాపార పత్రికలు.ఇది 338,000 (2Q, 2010) [1] సర్క్యులేషన్ కలిగి ఉంది.ఈ పత్రిక యొక్క ఫ్రీక్వెన్సీ పక్షం రోజులు. ==మూలాలు==
