ఈ భాష పత్రికఆంగ్ల , హిందీ లో ప్రచురించబడుతుంది న్యూఢిల్లీ లో దీని ప్రధాన కార్యాలయం ఉంది.ఈ పత్రికను ప్రచురిసితున్న కంపెనీ,సైన్స్ అండ్ ఎన్విరాన్‌మెంట్ సెంటర్ఇది భారతదేశం లోని పత్రిక సునీతా నారాయణ్ ,ఈ పత్రిక సంపాదకుడు. ఈ పత్రికా స్థాపించిన సంవత్సరం 2001.మే 1992[2] తేదీన ఈ పత్రిక మొదటి సంచిక విడుదలైంది. పర్యావరణం, సైన్స్, ప్రకృతి అనేవి పత్రికల వర్గాలు.ఇది 70,000 కాపీలు (2017)[1] సర్క్యులేషన్ కలిగి ఉంది.ఈ పత్రిక యొక్క ఫ్రీక్వెన్సీ పక్షం రోజులు. ==మూలాలు==
