ఇండియా టుడే అనేది ఆంగ్ల భాష పత్రిక.దీన్ని ప్రచురించినవారు లివింగ్ మీడియా ఇండియా లిమిటెడ్. దీని ప్రధాన కార్యాలయం నోయిడా, ఉత్తరప్రదేశ్[2] లో ఉంది.ఈ పత్రికను లివింగ్ మీడియా కంపెనీ ప్రచురిస్తుంది.ఇది భారతదేశం లోని పత్రిక
