ఔట్లుక్ అనేది ఆంగ్ల మరియు హిందీ భాష పత్రిక.దీన్ని ప్రచురించినవారు ఏబీపీ గ్రూప్. దీని ప్రధాన కార్యాలయం న్యూఢిల్లీ లో ఉంది.ఈ పత్రికను ప్రచురిసితున్న కంపెనీ,రాజన్ రహేజా గ్రూప్[3](ఔట్‌లుక్ పబ్లిషింగ్ (ఇండియా) ప్రైవేట్ లిమిటెడ్)[4]ఇది భారతదేశం లోని పత్రిక ఈ పత్రిక సంపాదకుడు చింకి సిన్హా[1].రాజేష్ రామచంద్రన్, కృష్ణ ప్రసాద్, వినోద్ మెహతా ,వీళ్ళు ఈ పత్రిక మాజీ సంపాదకులు 1995 సంవత్సరంలో ఈ పత్రిక స్థాపించబడింది.ఈ పత్రిక మొదటి సంచిక అక్టోబర్ 1995; 26 సంవత్సరాల క్రితం (1995-10) తేదీన విడుదలైంది. న్యూస్ మ్యాగజైన్ అనేవి పత్రికల వర్గాలు.దినికి 4,25,000 (2014 నాటికి)[2]సర్క్యులేషన్ ఉంది.ఈ యొక్క పత్రిక ఫ్రీక్వెన్సీ ,వారానికోసారి. ==మూలాలు==
