ఈ భాష పత్రికఆంగ్ల , హిందీ[5] లో ప్రచురించబడుతుంది ఏబీపీ గ్రూప్ లో దీని ప్రధాన కార్యాలయం ఉంది.ఇది భారతదేశం లోని పత్రిక బెర్ట్రాండ్ డిసౌజా ,ఈ పత్రిక సంపాదకుడు. ఈ పత్రికా స్థాపించిన సంవత్సరం 1961.ఈ పత్రిక మొదటి సంచిక సెప్టెంబర్, 1961 తేదీన విడుదలైంది. ఆటోమొబైల్ అనేవి పత్రికల వర్గాలు.ఇది 1,65,000 [3] సర్క్యులేషన్ కలిగి ఉంది.ఈ యొక్క పత్రిక ఫ్రీక్వెన్సీ ,నెలవారీ. ==మూలాలు==
