పీసి (PC) క్వెస్ట్ అనేది ఆంగ్ల భాష పత్రిక.దీన్ని ప్రచురించినవారు ప్రదీప్ గుప్తా. న్యూఢిల్లీ లో దీని ప్రధాన కార్యాలయం ఉంది.ఈ పత్రికను ప్రచురిసితున్న కంపెనీ,సైబర్ మీడియా ఇండియా లిమిటెడ్ఇది భారతదేశం లోని పత్రిక ఎల్ సుబ్రమణియన్, ప్రశాంత్ కుమార్ రాయ్, కృష్ణ కుమార్, అనిల్ చోప్రా ,వీళ్ళు ఈ పత్రిక మాజీ సంపాదకులు 1994 సంవత్సరంలో ఈ పత్రిక స్థాపించబడింది.ఈ పత్రిక మొదటి సంచిక 1994 తేదీన విడుదలైంది. విటి వర్గాలు ఏంటంటే,కంప్యూటర్.ఈ యొక్క పత్రిక ఫ్రీక్వెన్సీ ,నెలవారీ. ==మూలాలు==
