ఇది ఒక ఏబీపీ గ్రూప్ భాష పత్రిక.ఏబీపీ గ్రూప్దీన్ని ప్రచురించినవారు. దీని ప్రధాన కార్యాలయం చెన్నై లో ఉంది.ఈ పత్రికను ఏబీపీ గ్రూప్ కంపెనీ ప్రచురిస్తుంది.ఇది భారతదేశం లోని పత్రిక ఈ పత్రిక సంపాదకుడు అయోన్ సేన్‌గుప్తా. 1978; 44 సంవత్సరాల క్రితం (1978) సంవత్సరంలో ఈ పత్రిక స్థాపించబడింది.1978-07-15 00:00:00 తేదీన ఈ పత్రిక మొదటి సంచిక విడుదలైంది. క్రీడా పత్రిక అనేవి పత్రికల వర్గాలు.ఈ పత్రిక యొక్క ఫ్రీక్వెన్సీ పక్షం రోజులు. ==మూలాలు==
