ఇది ఒక ఆంగ్ల భాష పత్రిక.వి.మురళీ అమర్‌నాథ్ గోవిందరాజన్దీన్ని ప్రచురించినవారు. కోయంబత్తూరు/బెంగళూరు (2014–ప్రస్తుతం)చెన్నై (1956–1980) లో దీని ప్రధాన కార్యాలయం ఉంది.ఈ పత్రికను భరతన్ పబ్లికేషన్స్ ప్రైవేట్ లిమిటెడ్ (1956–2014) కోవై మీడియా ప్రైవేట్ లిమిటెడ్ (2014–ప్రస్తుతం) కంపెనీ ప్రచురిస్తుంది.ఇది భారతదేశం లోని పత్రిక
ఈ పత్రికా స్థాపించిన సంవత్సరం 1956.ఈ పత్రిక మొదటి సంచిక 14 జూలై 1956 (1956-07-14) తేదీన విడుదలైంది. విటి వర్గాలు ఏంటంటే,వార్తా పత్రిక.ఈ పత్రిక యొక్క ఫ్రీక్వెన్సీ నెలవారీ . ==మూలాలు==
