టింకిల్ అనేది ఆంగ్ల , హిందీ, మలయాళం, అస్సామీ భాష పత్రిక.దీన్ని ప్రచురించినవారు ఏబీపీ గ్రూప్. దీని ప్రధాన కార్యాలయం ఏబీపీ గ్రూప్ లో ఉంది.ఈ పత్రికను టింకిల్ కంపెనీ ప్రచురిస్తుంది.ఇది భారతదేశం లోని పత్రిక అనంత్ పాయ్ (1980 - 2010)రజనీ తిండియాత్ (2010 - 2020)కురియాకోస్ సాజు వైసియన్ (2020 - ప్రస్తుతం) ,ఈ పత్రిక సంపాదకుడు.ఈ పత్రిక మాజీ సంపాదకులు ఏబీపీ గ్రూప్. 1980 సంవత్సరంలో ఈ పత్రిక స్థాపించబడింది.1980-11-01 00:00:00 తేదీన ఈ పత్రిక మొదటి సంచిక విడుదలైంది. విటి వర్గాలు ఏంటంటే,హాస్య పుస్తకం.ఈ పత్రిక యొక్క ఫ్రీక్వెన్సీ వారానికోసారి. ==మూలాలు==
