ఈ భాష పత్రికఆంగ్ల , హిందీ లో ప్రచురించబడుతుంది న్యూఢిల్లీ లో దీని ప్రధాన కార్యాలయం ఉంది.ఈ పత్రికను ప్రచురిసితున్న కంపెనీ,Tehelka.com Pvt Ltdఇది భారతదేశం లోని పత్రిక చరణ్‌జిత్ అహుజా[1] ,ఈ పత్రిక సంపాదకుడు.తరుణ్ తేజ్‌పాల్, అనిరుద్ధ, బహల్, సంజయ్ దూబే ,వీళ్ళు ఈ పత్రిక మాజీ సంపాదకులు ఈ పత్రికా స్థాపించిన సంవత్సరం 1999[2].2007 తేదీన ఈ పత్రిక మొదటి సంచిక విడుదలైంది. విటి వర్గాలు ఏంటంటే,న్యూస్ పోర్టల్, మ్యాగజైన్.ఇది 58741 సగటు మార్చి (2019)* సర్క్యులేషన్ కలిగి ఉంది.ఈ యొక్క పత్రిక ఫ్రీక్వెన్సీ ,వారానికోసారి. ==మూలాలు==
